import { LockOpenOutlined, LockOutlined } from "@mui/icons-material";
import { Box, Typography } from "@mui/material";
import React, { useContext } from "react";
import { DataBorneContext } from "./ContextBorne";
import Validation from "./Validation";

function PostLogin() {
  const {
    MyBox,
    dataBorne,
    setDataBorne,
    progressBar,
    setprogressBar,
    loginEtat,
    setLoginEtat,
  } = useContext(DataBorneContext);

  function etatBorneIcon() {
    <MyBox
      sx={{
        display: "flex",
        flexDirection: "row",
        mx: 2,
        boxShadow: 5,
        borderRadius: 3,
        borderBlockColor: "gray",
        flexWrap: "wrap",
        justifyContent: "center",
        borderBlockWidth: 2,
        textAlign: "center",
        alignContent: "center",
        alignItems: "center",
      }}
    >
      <Box>
        <LockOutlined />
      </Box>
      <Box>
        <LockOpenOutlined />
      </Box>
    </MyBox>;
  }

  return (
    <MyBox
      sx={{
        p: 2,
        m: 5,
        mx: { xs: 5, md: "25%" },
        boxShadow: 5,
        borderRadius: 3,
        borderBlockColor: "gray",
        borderBlockWidth: 2,
        textAlign: "center",
        alignContent: "center",
        alignItems: "center",
      }}
    >
      <Typography variant="h6" sx={{ p: 2, pb: 5, m: 0 }}>
        Appuyer sur le bouton pour vous connecter
      </Typography>
      <Validation />
      <MyBox
        sx={{
          mx: 2,
          boxShadow: 5,
          borderRadius: 3,
          borderBlockColor: "gray",
          borderBlockWidth: 2,
          textAlign: "center",
          alignContent: "center",
          alignItems: "center",
        }}
      >
        {etatBorneIcon()}
      </MyBox>
    </MyBox>
  );
}

export default PostLogin;
